import React from "react";


function CategoryFilter() {
  return (
    <aside>
      <ul>
        <li className="category">
          <button className="btn btn-all-categories">All</button>
        </li>
        <li className="category">
          <button className="btn btn-category">Technology</button>
        </li>
      </ul>
    </aside>
  );
}

export default CategoryFilter;
